import logo from './logo.svg';
import './App.css';
import HomePage  from "./Components/HomePage"
import {
  BrowserRouter as Router,
  Link,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">


    <Router>

      <Route path ="/" component={HomePage }/>
    </Router>

    </div>
  );
}

export default App;
